// record page views for DWR calls in Google Analytics
if ( typeof gtag !== 'undefined' ) {
   const originalExecute = dwr.engine._execute;
   dwr.engine._execute = function( ...args ) {
      args[0] = Gemma.CONTEXT_PATH + args[0];
      gtag( 'event', 'page_view', {
         page_location : "/Gemma/" + args[1] + "/" + args[2]
      } );
      originalExecute( ...args );
   }
}

